@title DZooNFT
@author thomgabriel & canokaue
@notice Degen Zoo is a game based on Logan Paul's project CryptoZoo however, done right. Users earn Eggs by staking $DZOO tokens,
then being able to hatch, evolve & speed up their animals with tokens, or do the opposite and kill the NFT to earn $DZOO tokens.
The game is designed to simulate real-world financial incentives that cause millions of animal deaths around the world.
@dev Implementation of the Degen Zoo { ERC721 } with dynamic on-chain metadata NFT that changes based on user interactions with it.
This means that a array of bytes representing the { Base64 } encoded version of the dataURI with the JSON data instructions is calculated and saved on-chain
inheriting from { ERC721EnumerableUpgradeable } to enable enumeration of NFTs.
inheriting from { Ownable } to enable the contract owner to set the Degen Zoo ERC20 contract address.
inheriting from { ReentrancyGuardUpgradeable } to prevent reentrancy attacks.
inheriting from { DZooAnimals } to get the animals data.
